import React, { useEffect } from "react";
import {Link} from 'react-router-dom';
import {useDispatch, useSelector} from 'react-redux'

//import actions
import { getDog } from "../../actions/actions";

//imort components
import { Card } from "../card/card";
import { Nav } from "../nav/nav";

//import css
import './home.css'

export const Home = () => {

const dispatch = useDispatch();
const allDogs = useSelector ((state) => state.dogs);

useEffect (() => {
    dispatch(getDog());
}, [])

const handleSubmit = e => {
    e.preventDefault()
} 

    return(
        <>
        <Nav/>
            <div className = 'search_home'>
                <form onSubmit={handleSubmit}>
                    <input className = 'input_search_home' placeholder = 'Search...' type="text" />
                    <button className = 'buton_search_home'  type= 'submit'>Buscar</button>
                </form>
            </div>
            <div>
                <select>
                    <option value="temperaments">Temperaments</option>
                </select>
                <select>
                    <option value="existente">Existente</option>
                </select>
            </div>
            <div className = 'div_card_container'>
                {
                    allDogs.map( e => {
                        return(
                            <Card
                            key = {e.id}
                            name = {e.name}
                            image = {e.img.url}
                            temperament = {e.temperament}
                            />
                        )
                    })
                }
            </div>
        </>
    )
}
